	//alert(wheelRadius);
	var travel = wheelRadius / 3; // 3
	var sideFriction = 0.02; // 1.2
	var fwdFriction = 0.02; // 1.2
	var restingFrac = 0.4; // 0.4
	var dampingFrac = 0.5; // 0.5
	var rays = 2; // 2
	
	carBody.setupWheel("WheelFL", [steerFL.getLocX(),steerFL.getLocY(),steerFL.getLocZ()], sideFriction, fwdFriction, travel, wheelRadius, restingFrac, dampingFrac, rays);
	carBody.setupWheel("WheelFR", [steerFR.getLocX(),steerFR.getLocY(),steerFR.getLocZ()], sideFriction, fwdFriction, travel, wheelRadius, restingFrac, dampingFrac, rays);
	carBody.setupWheel("WheelBL", [wheelBL.getLocX(),wheelBL.getLocY(),wheelBL.getLocZ()], sideFriction, fwdFriction, travel, wheelRadius, restingFrac, dampingFrac, rays);
	carBody.setupWheel("WheelBR", [wheelBR.getLocX(),wheelBR.getLocY(),wheelBR.getLocZ()], sideFriction, fwdFriction, travel, wheelRadius, restingFrac, dampingFrac, rays);
	
	links.push({glge:carG,jig:carBody._chassis});
	
	//	test
	function interrogateObject(obj) {
		var out='';
		for (var att in obj) { out += att + ': ' + obj[att] + '<br />'; }
		return out;
	}
	
	function updateWheels()
	{
		steerFL.setDRotY(carBody.getWheel("WheelFL").getSteerAngle());
		steerFR.setDRotY(carBody.getWheel("WheelFR").getSteerAngle());
		
		wheelFL.setRotZ(carBody.getWheel("WheelFL").getRollAngle());
		wheelFR.setRotZ(carBody.getWheel("WheelFR").getRollAngle());
		wheelBL.setRotZ(carBody.getWheel("WheelBL").getRollAngle());
		wheelBR.setRotZ(carBody.getWheel("WheelBR").getRollAngle());
		
		var posFL = carBody.getWheel("WheelFL").getActualPos();
		var posFR = carBody.getWheel("WheelFR").getActualPos();
		var posBL = carBody.getWheel("WheelBL").getActualPos();
		var posBR = carBody.getWheel("WheelBR").getActualPos();
		
		steerFL.setLoc(posFL[0], posFL[1], posFL[2]);
		steerFR.setLoc(posFR[0], posFR[1], posFR[2]);
		wheelBL.setLoc(posBL[0], posBL[1], posBL[2]);
		wheelBR.setLoc(posBR[0], posBR[1], posBR[2]);
	}
	
	function updateStats()
	{
		var out='';
		out+='_destSteering: '+carBody._destSteering+', _steering: '+carBody._steering+'<br />';
		out+='_destAccelerate: '+carBody._destAccelerate+', _accelerate: '+carBody._accelerate+'<br />';
		out+='_HBrake: '+carBody._HBrake+'<br />';
		
		out+='chassis position X: '+carBody._chassis.get_currentState().position[0]+
			 ', Y: '+carBody._chassis.get_currentState().position[1]+
			 ', Z: '+carBody._chassis.get_currentState().position[2]+'<br />';
		
		out+='car rotation X: '+car.getRotX()+
			 ', Y: '+car.getRotY()+
			 ', Z: '+car.getRotZ()+'<br />';
		
		out+='wheels on the ground: '+carBody.getNumWheelsOnFloor(new Date())+'<br />';
		
		out+='WheelFL.getSteerAngle() FL, FR: '+carBody.getWheel("WheelFL").getSteerAngle()+', ';
		out+=carBody.getWheel("WheelFR").getSteerAngle()+'<br />';
		
		out+='WheelFL.getRollAngle() FL, FR, BL, BR: '+carBody.getWheel("WheelFL").getRollAngle()+', ';
		out+=carBody.getWheel("WheelFR").getRollAngle()+', ';
		out+=carBody.getWheel("WheelBL").getRollAngle()+', ';
		out+=carBody.getWheel("WheelBR").getRollAngle()+'<br />';

		out+='WheelFL.getActualPos()[1]: '+carBody.getWheel("WheelFL").getActualPos()[1]+'<br />';
		out+='WheelFR.getActualPos()[1]: '+carBody.getWheel("WheelFR").getActualPos()[1]+'<br />';
		out+='WheelBL.getActualPos()[1]: '+carBody.getWheel("WheelBL").getActualPos()[1]+'<br />';
		out+='WheelBR.getActualPos()[1]: '+carBody.getWheel("WheelBR").getActualPos()[1]+'<br />';
		
		document.getElementById('debug').innerHTML=out;
	}
	
	function dumpObject(obj, property)
	{ 
		var out='';
		for (var k in obj)
		{
			out+=' &nbsp; &nbsp;'+k+': '+((property) ? obj[property] : obj[k])+'<br />';
		}
		return out;
	}
	
	function degToRad(deg) {
		return (deg*3.14159)/180;
	}
	
	function radToDeg(rad) {
		return rad*(180/3.14159);
	}
	
	var lasttime=(new Date()).getTime();
	function render(){
		var now=(new Date()).getTime();
		var inttime=(now-lasttime)/1000;
		if (inttime<0.05) inttime=0.05;
		system.integrate((now-lasttime)/1000);
		lasttime=now;
		
		for(var i=0; i<links.length;i++){
			links[i].glge.setLocX(links[i].jig.get_currentState().position[0]);
			links[i].glge.setLocY(links[i].jig.get_currentState().position[1]);
			links[i].glge.setLocZ(links[i].jig.get_currentState().position[2]);
			var ori=GLGE.Mat4(links[i].jig.get_currentState().get_orientation().glmatrix);
			links[i].glge.setRotMatrix(ori);
		}
		
		updateWheels();
		updateStats();
		
		renderer.render();
	}
	
	setInterval(render,30);
}

XMLdoc.parseScript("glge_document");
